import React, { useState, useEffect } from 'react';
import { useNavigate, useParams } from 'react-router-dom';
import './Alternatives.css';
import modelsData from './models.json';
import mockData from './mockData.json'; // Importa el archivo JSON con los datos simulados

const Alternatives = ({ onRestart }) => {
  const { modelId } = useParams();
  const navigate = useNavigate();
  const [relatedModels, setRelatedModels] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  const model = modelsData.models.find(model => model.id === parseInt(modelId));

  useEffect(() => {
    if (!model) {
      setLoading(false);
      setError('Model not found');
      return;
    }

    const fetchRelatedModels = async () => {
      try {
        const results = ['good', 'better', 'best'].map(key => {
          const sku = model.relatedModels[key];
          const result = mockData[sku]; // Usa los datos simulados
          if (!result) {
            throw new Error('Data not found for SKU: ' + sku);
          }
          return result;
        });
        setRelatedModels(results);
      } catch (error) {
        setError(error.message);
      } finally {
        setLoading(false);
      }
    };

    fetchRelatedModels();
  }, [model]);

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>Error: {error}</div>;
  }

  const getDescription = (attributes) => {
    const attribute = attributes.find(attr => attr.attribute_code === 'description');
    return attribute ? attribute.value : 'No description available';
  };

  const getUrlKey = (attributes) => {
    const attribute = attributes.find(attr => attr.attribute_code === 'url_key');
    return attribute ? attribute.value : '';
  };

  return (
    <div className="alternatives-container">
      <h2 className='title'>Best-in-Class Options</h2>

      {/* Información del modelo seleccionado */}
      <div className="selected-model-container">
        <h3>Selected Model</h3>
        <div className="model-card d-flex flex-wrap justify-content-center">
          {model.media_gallery_entries && model.media_gallery_entries[0] ? (
            <img src={`${model.media_gallery_entries[0].file}`} alt={model.name} />
          ) : (
            <div>No image available</div>
          )}
          <h4>{model.name}</h4>
          <p>SKU: {model.sku}</p>
          <p className='description' dangerouslySetInnerHTML={{ __html: getDescription(model.custom_attributes) }}></p>
          <a className='rounded-pill' href={`/product/${getUrlKey(model.custom_attributes)}`} target="_blank" rel="noopener noreferrer">View Details</a>
        </div>
      </div>

      <div className="flex-container">
        {relatedModels.map((relatedModel, index) => (
          <div key={index} className={`model-card ${['good', 'better', 'best'][index]} d-flex flex-wrap justify-content-center`}>
            <h3 className='d-flex justify-content-center align-items-center'>{['Good', 'Better', 'Best'][index]}</h3>
            {relatedModel.media_gallery_entries && relatedModel.media_gallery_entries[0] ? (
              <img src={`${relatedModel.media_gallery_entries[0].file}`} alt={relatedModel.name} />
            ) : (
              <div>No image available</div>
            )}
            <h4>{relatedModel.name}</h4>
            <p>SKU: {relatedModel.sku}</p>
            <p className='description' dangerouslySetInnerHTML={{ __html: getDescription(relatedModel.custom_attributes) }}></p>
            <a className='rounded-pill' href={`/product/${getUrlKey(relatedModel.custom_attributes)}`} target="_blank" rel="noopener noreferrer">View Details</a>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Alternatives;
